import React, { Component } from 'react';

class Prize extends Component {


  generatePrizes = () => {
    this.props.prizes.map(prize => <p>prize.title</p>)
  }


  render() {

    const prizes = this.generatePrizes();

    return(
      <React.Fragment>
        { prizes }
      </React.Fragment>
    )
  }
}

export default Prize;
